<template>

<div class="trainer-first">
  <div class=""></div>
  <div class="around-box">
    <div>ALL ({{data.ALL_num}})</div>
    <div class="around-box" >
      <div @click="changeListMode">수강생</div>
      <div>&nbsp;/&nbsp;</div>
      <div @click="changeListMode">신청자</div>
    </div>
    <div><SearchBar @search="search" v-model="data.searchValue"/></div>
  </div>
  <div class="deco-bar"></div>
  <div></div>
  <div class="list-mode-box" v-show="data.listMode">
    <CurrentListEx :listMode="data.listMode"/>
    <CurrentListItem v-for="( t_item, i ) in trainerList"
    :hide="changeList(i)"
    :key="i"
    :imgData="data.img[i]"
    :nameData="trainerList[i].name"
    :exerciseData="trainerList[i].exercise_category"
    :priceData="trainerList[i].exercise_price"
    :trainer="trainerList[i]"
    @toggleModal="toggleModal"/>
  </div>

  <div class="list-mode-box" v-show="!data.listMode">
    <ApplicantListEx/>
    <ApplicantListItem v-for="( t_item, i ) in trainerList"
    :hide="changeList(i)"
    :key="i"
    :imgData="data.img[i]"
    :nameData="trainerList[i].name"
    :exerciseData="trainerList[i].exercise_category"
    :priceData="trainerList[i].exercise_price"
    :trainer="trainerList[i]"
    @toggleModal="toggleModal"/>
  </div>

  <div class="deco-bar"></div>
  <div class="trainer-page-nation"> <PageNation  @changePage="changePage"/></div>
  <TrainerDetailModal v-show="data.is_modal" :trainer="data.trainerId" @toggleModal="toggleModal"/>
</div>

</template>

<script>
import TrainerDetailModal from '@/components/trainer/TrainerDetailModal.vue'
import SearchBar from '@/components/common/SearchBar.vue'

import ApplicantListEx from '@/components/counselting/ApplicantListEx.vue'
import ApplicantListItem from '@/components/counselting/ApplicantListItem.vue'

import CurrentListEx from '@/components/counselting/CurrentListEx.vue'
import CurrentListItem from '@/components/counselting/CurrentListItem.vue'

import PageNation from '@/components/common/PageNation.vue'
import { computed, reactive, ref } from 'vue'
import { useStore } from 'vuex'
export default {
  name: 'CounseltingView',
  components: { SearchBar, ApplicantListEx, ApplicantListItem, CurrentListEx, CurrentListItem, PageNation, TrainerDetailModal },
  setup () {
    const store = useStore()
    const trainerList = ref(computed(() => store.getters.trainerList))
    const listMode = ref(computed(() => store.getters.listMode))
    const data = reactive({
      img: [
        'data:image/png;base64,',
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,'],
      trainerId: '0',
      listMode: true,
      pageStart: 0,
      pageEnd: 4,
      is_modal: false
    })
    const getTrainerList = store.dispatch('trainerList')
    function search (searchValue) {
      console.log(searchValue)
      store.dispatch('trainerSearch', searchValue)
    }
    function changePage (pageValue) {
      data.pageStart = 4 * (pageValue - 1)
      data.pageEnd = 4 * pageValue
    }
    function changeList (i) {
      if (data.pageStart <= i && i < data.pageEnd) {
        console.log(i, true)
        return true
      } else {
        console.log(i, false)
        return false
      }
    }
    function toggleModal (isModal) {
      data.is_modal = isModal
    }
    function changeListMode () {
      data.listMode = !data.listMode
    }
    return {
      trainerList,
      getTrainerList,
      listMode,
      changePage,
      changeList,
      search,
      data,
      changeListMode,
      toggleModal
    }
  }
}
</script>

